import React from 'react';
import ReactDOM from 'react-dom';

const App = () => {
	return (
		<div>
			<label htmlFor="name">Enter your Name</label>
			<input id="name" type="text" />
			<button>Submit</button>
		</div>
	);
};

ReactDOM.render(<App />, document.querySelector('#root'));
